#Extra contracts to fill out the database
#Dates are randomly generated, between Jan 1st 2017 and Aug 1st 2017. Time of day is always 00:00:01
#Contract category, company, type, etc. are all randomly assigned.
#Deliverables are randomly generated according to a normal distribution, with mean matching the delivery schedule,
#standard deviation of 0.2 per day. First deliverable is random, second deliverable is first deliverable plus a random normal variable
#Satisfaction scores are normally distributed, with a mean of 6 and a standard deviation of 2. Minimum is 1, maximum is 10. 

use company_cms;


update contracts
set fourth_deliv = null
where contract_category != 'Silver';
